import React, { useState, useEffect } from "react";
import { fetchWatch } from "./ApiCalls";

const Watchlist = () => {
  const [watchlist, setWatchlist] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [selectedWatch, setSelectedWatch] = useState(null);
  const [showModal, setShowModal] = useState(false);
  const [showEditModal, setShowEditModal] = useState(false);
  const [formData, setFormData] = useState({
    dates: "",
    symbol: "",
    price: "",
    target_price: "",
    exp_date: "",
    plan: "",
  });

  // Fetch watchlist data from API
  // using fetchWatch from "./ApiCalls"

  // Function to handle form submission for adding watchlist item
  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await fetch("http://localhost:8000/watchlist/", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify(formData),
      });
      if (!response.ok) {
        throw new Error("Failed to add watchlist item");
      }
      const data = await response.json();
      // Clear the form data
      setFormData({
        dates: "",
        symbol: "",
        price: "",
        target_price: "",
        exp_date: "",
        plan: "",
      });
      // Close the modal
      // refetch the watchlist
    } catch (err) {
      setError(err.message);
    }
  };

  // Function to handle clicking on a watchlist item for editing
  const handleListItemClick = (watchlistItem) => {
    setSelectedWatch(watchlistItem);
    setShowEditModal(true);
  };
  // Function to handle form input change

  // Function to handle form submission for editing watchlist item
  const handleEditSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await fetch(
        `http://localhost:8000/watchlist/${selectedWatch.id}`,
        {
          method: "PUT",
          headers: {
            "Content-Type": "application/json",
          },
          body: JSON.stringify(selectedWatch),
        }
      );
      if (!response.ok) {
        throw new Error("Failed to update watchlist item");
      }
      // Assuming the response contains the updated watchlist item data
      const updatedWatchlistItem = await response.json();
      // Update the watchlist state with the updated item
      setWatchlist((prevWatchlist) =>
        prevWatchlist.map((item) =>
          item.id === updatedWatchlistItem.id ? updatedWatchlistItem : item
        )
      );
      // Close the edit modal
      setShowEditModal(false);
      fetchWatch();
    } catch (err) {
      setError(err.message);
    }
  };

  if (loading) return <p>Loading...</p>;
  if (error) return <p>Error: {error}</p>;

  return (
    <div className="watchlist">
      <div className="header">
        <p>Watchlist</p>
        <i
          className="fa-solid fa-plus"
          id="new-btn"
          onClick={() => setShowModal(true)}
        ></i>
      </div>
      <div className="list">
        <ul className="item">
          {watchlist.map((entry, index) => (
            <li
              key={index}
              className="card-content"
              onClick={() => handleListItemClick(entry)}
            >
              <div className="left">
                <p className="symbol">{entry[2]}</p>
              </div>
              <div className="right">
                <p className="dates">
                  Date: {entry[1]?.split("-").slice(1).join("/")}
                </p>
                <p className="price">Price: ${entry[3]}</p>
                <p className="target-price">Target: ${entry[4]}</p>
                <p className="exp-date">
                  Expiry: {entry[5]?.split("-").slice(1).join("/")}
                </p>
              </div>
            </li>
          ))}
        </ul>
      </div>
      {showModal && (
        <div className="form-modal">
          <div className="form-modal-content">
            <div className="header">
              <p>Watchlist</p>
              <span className="close" onClick={() => setShowModal(false)}>
                &times;
              </span>
            </div>
            <form className="new-trade-form" onSubmit={handleSubmit}>
              <label htmlFor="dates">Date:</label>
              <input
                type="date"
                name="dates"
                value={formData.dates}
                onChange={handleChange}
              />

              <label htmlFor="symbol">Symbol:</label>
              <input
                type="text"
                name="symbol"
                value={formData.symbol}
                onChange={handleChange}
              />

              <label htmlFor="price">Price:</label>
              <input
                type="text"
                name="price"
                value={formData.price}
                onChange={handleChange}
              />

              <label htmlFor="target_price">Target Price:</label>
              <input
                type="text"
                name="target_price"
                value={formData.target_price}
                onChange={handleChange}
              />

              <label htmlFor="exp_date">Exp. Date:</label>
              <input
                type="date"
                name="exp_date"
                value={formData.exp_date}
                onChange={handleChange}
              />

              <label htmlFor="plan">Plan:</label>
              <input
                name="plan"
                value={formData.plan}
                onChange={handleChange}
              ></input>

              <button type="submit">Add</button>
            </form>
          </div>
        </div>
      )}
      {showEditModal && selectedWatch && (
        <div className="form-modal">
          <div className="form-modal-content">
            <div className="header">
              <span className="close" onClick={() => setShowEditModal(false)}>
                &times;
              </span>
              <div>{selectedWatch.symbol}</div>
            </div>

            <form className="edit-trade-form" onSubmit={handleEditSubmit}>
              <label htmlFor="option_type">Option Type:</label>
              <input
                type="text"
                name="option_type"
                value={selectedWatch.optionType}
                onChange={(e) =>
                  setSelectedWatch({
                    ...selectedWatch,
                    optionType: e.target.value,
                  })
                }
              />

              <label htmlFor="strike_price">Strike Price:</label>
              <input
                type="text"
                name="strike_price"
                value={selectedWatch.strikePrice}
                onChange={(e) =>
                  setSelectedWatch({
                    ...selectedWatch,
                    strikePrice: e.target.value,
                  })
                }
              />
              <label htmlFor="contracts">Contracts:</label>
              <input
                type="text"
                name="contracts"
                value={selectedWatch.contracts}
                onChange={(e) =>
                  setSelectedWatch({
                    ...selectedWatch,
                    contracts: e.target.value,
                  })
                }
              />

              <label htmlFor="entry_price">Entry Price:</label>
              <input
                type="text"
                name="entry_price"
                value={selectedWatch.entryPrice}
                onChange={(e) =>
                  setSelectedWatch({
                    ...selectedWatch,
                    entryPrice: e.target.value,
                  })
                }
              />

              <label htmlFor="exit_price">Exit Price:</label>
              <input
                type="text"
                name="exit_price"
                value={selectedWatch.exitPrice}
                onChange={(e) =>
                  setSelectedWatch({
                    ...selectedWatch,
                    exitPrice: e.target.value,
                  })
                }
              />

              <label htmlFor="close_date">Close Date:</label>
              <input
                type="date"
                name="close_date"
                value={selectedWatch.closeDate}
                onChange={(e) =>
                  setSelectedWatch({
                    ...selectedWatch,
                    closeDate: e.target.value,
                  })
                }
              />

              <button type="submit">Update</button>
            </form>
          </div>
        </div>
      )}
    </div>
  );
};

export default Watchlist;
